import React from 'react'

const BotSpecs = ({card , onClose}) => {
  return (
    <div>
      <img
        src={card.avatar_url}
        alt={card.name}
        className="card-img-top"
        style={{ 
          backgroundColor: "grey", 
          width:"300px" ,
          marginLeft:"200px"
        }}
      />

      {/*create a card body */}
      <div className="card-body">
        <h2 className="card-name" style={{ marginLeft: "70px" }}>
          {card.name}
        </h2>
       <p>{card.catchphrase}</p>

        {/* create a div for icons */}
        <div style={{ marginLeft: "50px" }}>
          <i
            className="fas fa-heartbeat"
            style={{ fontSize: "12px", marginRight: "5px" }}
          ></i>
          <span style={{ fontSize: "15px" }}>{card.health}</span>
          <i
            className="fas fa-bolt"
            style={{ fontSize: "12px", marginLeft: "15px" }}
          ></i>
          <span style={{ fontSize: "15px", marginLeft: "5px" }}>{card.damage}</span>
          <i
            className="fas fa-shield-alt"
            style={{ fontSize: "12px", marginLeft: "15px" }}
          ></i>
          <span style={{ fontSize: "15px", marginLeft: "5px" }}>{card.armor}</span>
          <span style={{display:"block", marginTop:"20px"}}><button type="button" class="btn btn-primary" onClick={onClose}>Go Back</button></span>
        </div>
      </div>
    </div>
  );
};


export default BotSpecs
